package com.hr.cc;

import java.util.HashMap;

public class ValidAnagram {
	public boolean isAnagram(String s, String t) {
		if (s.length() != t.length())
			return false;
		// System.out.println("same length "+ s.length()+ " "+t.length());
		HashMap<Character, Integer> freqCount1 = freqCounter(s);
		HashMap<Character, Integer> freqCount2 = freqCounter(t);
		// char x='a';
		for (char key : freqCount1.keySet()) {
			if (!freqCount2.containsKey(key) || freqCount1.get(key).intValue() != freqCount2.get(key).intValue()) {
				System.out.println(
						"The value of " + key + " freq1" + freqCount1.get(key) + " freq2" + freqCount2.get(key));
				break;
			}
		}
		System.out.println(freqCount1.size()+" "+freqCount2.size());

		return true;

	}

	public HashMap<Character, Integer> freqCounter(String s) {
		HashMap<Character, Integer> freqMap = new HashMap<Character, Integer>();
		for (char ch : s.toCharArray()) {
			if (freqMap.containsKey(ch)) {
				freqMap.put(ch, freqMap.get(ch) + 1);
			} else
				freqMap.put(ch, 1);
		}
		return freqMap;
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s = "";
		String t = "";
		ValidAnagram a = new ValidAnagram();
		System.out.println(a.isAnagram("a",""));
	}

}
